// src/App.js
import './index.css'; // or wherever your main CSS file is

import React from 'react';
import LandingPage from './components/LandingPage';
import CryptoRates from './components/CryptoRates';
import CryptoCurrency from './components/Header';
import TokenBlock from './components/TokenBlock';

function App() {
  return (
    <div className="App bg-white">
      <LandingPage />
      <CryptoRates name='ETH' />
      <CryptoCurrency />
      <TokenBlock />

    </div>
  );
}

export default App;
